import React from "react";

export const Headers = () => {
  return (
    <div className="md:flex w-100">
      <h1 className="m-2 max-w-lg text-2xl font-bold text-center md:text-4xl md:text-left sm:m-10 ">
        The Logo
      </h1>
      <div className="text-sm  bg-[#DDE8FE] md:items-center md:text-center lg:w-1000px  rounded-b-lg absolute lg-right-20 lg:h-32  shadow-lg shadow-500/40 sm:text-sm">
        <ul className="list-none  lg:m-20 lg:gap-12 md:gap-10 list-inside flex decoration-none font-semibold ">
          <li className="underline cursor-pointer lg:my-0 md:my-8">HOME</li>
          <li className="cursor-pointer lg:my-0 md:my-8">PLACEMENT STATISTICS</li>
          <li className="cursor-pointer lg:my-0 md:my-8">CONTACT US</li>
          <button className="bg-transparent hover:bg-blue-500 text-blue-700 font-semibold hover:text-white px-4 border border-blue-500 hover:border-transparent rounded">RESUME BUILDER</button>
        </ul>
      </div>
    </div>
  );
};
